import React, {useState} from 'react';
import logo from "./logo.svg";
import "./App.css";

function App() {
    let contents = [
        { title: "title1", content: "content1" },
        { title: "title2", content: "content2" },
        { title: "title3", content: "content3" },
        { title: "title4", content: "content4" },
        { title: "title5", content: "content5" },
    ];

    return (
        <div className="App">
            <header className="navbar bg-dark navbar-dark fixed-top sticky-top">
                <div className="navbar-header max-width">
                    <a href="#" class="navbar-brand">
                        Logo
                    </a>
                </div>
            </header>
            <div className="content">
                {contents.map((contents, index) => (
                    <div className="content-item row m-0">
                        <div className="content-title col-4">{contents.title}</div>
                        <div className="content-content col-8">{contents.content}</div>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default App;
